import React from 'react';

function Logo(props) {
    return (
        <React.Fragment>
        {props.logoOpen &&
            <div className="component logo">
                <h1 className='logo-title'>THE NEON PYRAMID</h1>
                <video className='video' playsinline autoplay muted loop id="bgvid">
                    <source src="../assets/test_neon_tri_logo.mp4" type="video/mp4"/>
                    {/* <source src="polina.mp4" type="video/mp4"/> */}
                </video>
            </div>
        }
        </React.Fragment>
    );
}

export default Logo;
